import React from 'react';
import styled from 'styled-components';
import { FooterContainer, FooterTextBackgroundGreen, FooterTextBackgroundYellow, FooterTextBackgroundRed, FooterCopyrightContainer, FooterCopyrightText } from './footer.styles';

const Footer = () => {
    var d = new Date();
    var n = d.getFullYear();
    return (
        <FooterContainer>
          <FooterTextBackgroundRed>
            &nbsp;
          </FooterTextBackgroundRed>
          <FooterTextBackgroundYellow>
            &nbsp;
          </FooterTextBackgroundYellow>
          <FooterTextBackgroundGreen>
            &nbsp;
            <center><FooterCopyrightContainer><FooterCopyrightText>&#169; {n}, Dale Street Studio, LLC</FooterCopyrightText></FooterCopyrightContainer></center>
          </FooterTextBackgroundGreen>
        </FooterContainer>
    );
};

export default Footer;
